from mnist import MNIST
import random
import numpy as np
mndata = MNIST('C:/Users/win10/Desktop/sample')

images, labels = mndata.load_training()
testImages,testLables = mndata.load_testing()
for i in range(len(images)):
    images[i] += [1] #bias
for i in range(len(testImages)):
    testImages[i] += [1] #bias
w = [[0 for i in range(len(images[0]))] for j in range(10)] # weight
w[0][0] = 1 #bias
for i in range(1,len(w)):
    w[i][0] = 0
# training:
counter = 0
while(counter < 10):
    for i in range(len(images)):
        max = 0
        index = 0
        for j in range(len(w)):
            temp = np.dot(w[j], images[i])
            if temp > max:
                max = temp
                index = j
        if index != labels[i]:
            for j in range(len(w[index])):
                w[index][j] -= images[i][j]
                w[labels[i]][j] += images[i][j]
    counter += 1
    print("counter : ", counter)
print(w)
#testing:
correct = 0
for i in range(len(testImages)):
    max = 0
    index = 0
    for j in range(len(w)):
        temp = np.dot(w[j],testImages[i])
        if temp > max:
            max = temp
            index = j
    if index == testLables[i]:
        correct += 1
print("the correctness ratio is: ",correct/100)
